import { useState, useEffect } from "react";
import "bootstrap/dist/css/bootstrap.css";

const TimelineView = (
    switchToTimelineView,
    switchToRiseofRomeView,
    switchToPunicWarsView,
    switchToFallofRomeView,
    switchToStudentView,
    switchToInventoryView
) => {
    return(
        <div>
            <div style={{ backgroundColor: "green", display: "flex", justifyContent: "center", height: "80px" }}>
                <button
                    className="bg-gray-50 border border-black text-gray-900 text-sm rounded-lg p-1"
                    style={{ borderRadius: "10px", height: "35px", marginTop: "20px" }}
                    onClick={() => switchToTimelineView}
                >
                    Timeline
                </button>
                <button
                    className="bg-gray-50 border border-black text-gray-900 text-sm rounded-lg p-1"
                    style={{ marginLeft: "90px", borderRadius: "10px", height: "35px", marginTop: "20px" }}
                    onClick={switchToRiseofRomeView}
                >
                    Rise Of Rome
                </button>
                <button
                    className="bg-gray-50 border border-black text-gray-900 text-sm rounded-lg p-1"
                    style={{ marginLeft: "90px", borderRadius: "10px", height: "35px", marginTop: "20px" }}
                    onClick={switchToPunicWarsView}
                >
                    Punic Wars
                </button>
                <button
                    className="bg-gray-50 border border-black text-gray-900 text-sm rounded-lg p-1"
                    style={{ marginLeft: "90px", borderRadius: "10px", height: "35px", marginTop: "20px" }}
                    onClick={switchToFallofRomeView}
                >
                    Fall of Rome
                </button>
                <button
                    className="bg-gray-50 border border-black text-gray-900 text-sm rounded-lg p-1"
                    style={{ marginLeft: "90px", borderRadius: "10px", height: "35px", marginTop: "20px" }}
                    onClick={switchToStudentView}
                >
                    Information about the Students
                </button>
                <button
                    className="bg-gray-50 border border-black text-gray-900 text-sm rounded-lg p-1"
                    style={{ marginLeft: "90px", borderRadius: "10px", height: "35px", marginTop: "20px" }}
                    onClick={switchToInventoryView}
                >
                    Inventory
                </button>
            </div>
        </div>
    );
}

export default TimelineView;
